import PropTypes from 'prop-types'
import Link from 'next/link'
import { withTranslation } from '../i18n'
import styles from '../styles/projects.module.sass'
import ProjectsData from "../resources/projects.js"

const projects = ProjectsData;

const Projectslist = ({props}) => {
    return (
            props.projects.map(project => {
          <div key={project.id} {...pageProps}>
            {project.image ? (
              <div className={styles.box}>
                <img
                  className={styles.projectImg}
                  src={project.image}
                  alt="Projectpicture"
                />
                <div className={styles.mask}>
                  <Link
                    href={`/projects/${project.id}`}
                    props={project.image}
                    className="link"
                  >
                    <p className={styles.project_title}>{project.title}</p>
                  </Link>
                </div>
              </div>
            ) : (
              <div className={styles.project_heading}>
                <Link
                  href={`/projects/${project.id}`}
                  props={project.image}
                  className={styles.link_without_image}
                >
                  <p>â€¢ {project.title}</p>
                </Link>
              </div>
            )}
          </div>
            })
    )}

export async function getStaticProps() {
        // Call an external API endpoint to get posts.
        // You can use any data fetching library
        const projects = await import('../resources/projects_backup.json')      
        // By returning { props: posts }, the Blog component
        // will receive `posts` as a prop at build time
        return {
          props: {
            projects,
          },
        }
      }
export default Projectslist
